import React from "react";

export default function Sender(props) {
    return (
        <>
            <div style={{
                display: "flex",
                flexDirection: "row",
            }}>
                <input type="text" placeholder="Message" />
                <button style={{
                    marginLeft: "5px",
                    padding: "5px",
                    backgroundColor: "#218aff",
                    color: "white",
                    border: "none",
                    borderRadius: "5px",
                    fontSize: "1rem",
                    fontWeight: "bold",
                    alignSelf: "flex-end",
                }}>Send</button>
            </div>
        </>
    );
}
